import { CardPokemon } from'./CardPokemon'


export const PokemonList = () => {



  return (
    <>
     <div className="card-list-pokemon contaner">
           {allPokemons.map(pokemon => (
           <CardPokemon pokemon={pokemon} key={pokemon.id} />
           ))}
     </div>
     </>
  );
}
